import "./Home.css";

const Home = () => {
  return (
      <div className="homecontainer">
      

      {/*  First home container*/ }

      <div className="homecontainersub">
        <div><div className="headingcontainer">
          <b>
            Lorem ipsum dolor sit amet,<br></br>
            <p className="colorchange">consectrtur adipising elit</p>
          </b>
        </div>
        <div className="textcontainer">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc
          vulputate<br></br>
          libero et velit interdum, ac aliquet odio mattis. Class optent taciti
